import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useHistory, Link } from 'react-router-dom'
import { getTemperamentsList, postDog } from '../../Redux/actions'

export default function DogCreate(){
    const dispatch = useDispatch()
    const temperament = useSelector((state) => state.temperament)

    const [input, setInput] = useState({
        name: "",
        image:"",
        height_min: "",
        height_max: "",
        weight_min: "",
        weight_max: "",
        life_span: "",
        temperament: [],

})

    useEffect(() =>{
        dispatch(getTemperamentsList());
    }), [];

    function handleChange(e) {
        setInput({
            ...input,
            [e.target.name]: e.target.value,
        })
        setErrors(validate({
            ...input,
            [e.target.name]: e.target.value,
        }))
        console.log(input)
    }

    function handleSelect(e) {
        if (!input.temperament.includes(e.target.value)) {
            setInput({
                ...input,
                temperament: [...input.temperament, e.target.value]
            })
            console.log(input)
        }
    }

    function handleSubmit(e) {
        e.preventDefault()
        if (!Object.getOwnPropertyNames(errors).length && input.name && input.heightMin && input.heightMax && input.weightMin && input.weightMax && input.life_span /*&& input.temperaments.length*/ /*&& input.origins.length*/) {

            if (!input.image) {
                input.image = robot
            }
            dispatch(postDog(input))
            alert('Se creo una nueva raza')
            setInput({
                name: '',
                height_min: '',
                height_max: '',
                weightMin: '',
                weight_max: '',
                life_span: '',
                image: '',
                temperament: [],
            })
            history.push('/home')
        } else {
            alert('No se creo el perro')
        }
    }

    function handleDelete(e) {
        setInput({
            ...input,
            temperaments: input.temperament.filter(temp => temp !== e)
        })
    }




    return(
        <div>
            <Link to= '/home'><button>Volver</button></Link>
            <h1>Crea tu Doggi</h1>
            <form>
                <div>
                    <label>Nombre:</label>
                    <input
                    type = 'text'
                    value = {input.name}
                    name = 'name'
                    />
                </div>

                <div>
              <label>Image URL:</label>
              <input
                type="url"
                value={input.image}
                name="image"
                onChange={(e) => handleChange(e)}
              />
              </div>

                <div>
                    <h4>Heights</h4>
                    <label>Min</label>
                    <input
                    type="number"
                    value={input.height_min}
                    name="height_min"
                    placeholder="20"
                    onChange={(e) => handleChange(e)}
                    required
                 />
                    <label>Max</label>
                    <input
                    type="number"
                    value={input.height_max}
                    name="height_max"
                    placeholder="50"
                    onChange={(e) => handleChange(e)}
                    required
              />
                </div>
            <div>
            <h4>Weights</h4>
              <label>Min</label>
              <input
                type="number"
                value={input.weight_min}
                name="weight_min"
                placeholder="15"
                onChange={(e) => handleChange(e)}
                required
              />
              <label>Max</label>
              <input
                type="number"
                value={input.weight_max}
                name="weight_max"
                placeholder="32"
                onChange={(e) => handleChange(e)}
                required
              />
            </div>
            <div>
              <label>Life Span</label>
              <input
                type="text"
                value={input.life_span}
                name="life_span"
                placeholder="12 - 15 years"
                onChange={(e) => handleChange(e)}
              />
            </div>
            <div className>
              <label>Temperaments</label>
              <select onChange={(e) => handleSelect(e)} >
                {temperament.map((temp) => {
                  return (
                    <option key={temp} name={temp}>
                      {temp}
                    </option>
                  );
                })}
                 </select>
                <div className>
                <h4>You have selected that:</h4>
                {input.temperament.map((el) => (
                  <div key={el} >
                    <p>{el}</p>
                    <button onClick={() => handleDelete(el)}>x</button>
                  </div>
                ))}
              </div>
            </div>
            <div>
              <Link to="/home">
                <button >Cancel</button>
              </Link>
              <button type="submit">
                Creat 🐕
              </button>
            </div>

            </form>
        </div>
    )
}
